import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { NavLink } from "react-router-dom";
import "./Login.css";

const RegistrationForm = () => {
  const Navigate = useNavigate();
  const [user, setUser] = useState({
    username: "",
    email: "",
    phone: "",
    password: "",
    cpassword: "",
  });

  let name, value;

  const handleInput = (e) => {
    console.log(e);
    name = e.target.name;
    value = e.target.value;
    setUser({ ...user, [name]: value });
  };

  const postData = async (e) => {
    e.preventDefault(); //preventing automatic reloading default behavior

    const { username, email, phone, password, cpassword } = user;
    const res = await fetch("/register", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      //converting data to string (server only accepts data in string format)
      body: JSON.stringify({
        username,
        email,
        phone,
        password,
        cpassword,
      }),
    });
    const data = await res.json();

    if (
      data.status === 400 ||
      !username ||
      !email ||
      !phone ||
      !password ||
      !cpassword
    ) {
      window.alert("Invalid Registration");
      console.log("Invalid Registration");
    } else {
      window.alert("Registration Successful");
      console.log("Registration Successful");
      Navigate("./login");
    }
  };

  return (
    <div className="login-signup-main">
      <h2>Don't have an Account</h2>
      <h2>Signup Now</h2>
      <div className="card">
        <img
          src="./Images/signup.png"
          alt="Signupimage"
          className="loginsignupimage"
        />
        <form method="POST" id="register-form">
          <label htmlFor="username">Username:</label>
          <input
            name="username"
            type="text"
            id="username"
            autoComplete="off"
            pattern="[a-zA-Z]"
            value={user.username}
            onChange={handleInput}
            required
          />

          <br />
          <label htmlFor="phone">Phone Number:</label>
          <input
            placeholder="921234567890"
            name="phone"
            type="text"
            id="phone"
            autoComplete="off"
            pattern="[0-9]{10}"
            value={user.phone}
            onChange={handleInput}
            required
          />
          <br />
          <label htmlFor="email">Email:</label>
          <input
            placeholder="abc@domain.com"
            name="email"
            type="email"
            id="email"
            autoComplete="off"
            pattern="[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,}$"
            value={user.email}
            onChange={handleInput}
            required
          />
          <br />
          <label htmlFor="password">Password:</label>
          <input
            placeholder="at least 8 characters, including at least 1 letter and 1 number"
            name="password"
            type="password"
            id="password"
            autoComplete="off"
            pattern="(?=.*\d)(?=.*[a-zA-Z]).{8,}"
            value={user.password}
            onChange={handleInput}
            required
          />
          <br />
          <label htmlFor="cpassword">Confirm Password:</label>
          <input
            name="cpassword"
            type="password"
            id="cpassword"
            autoComplete="off"
            value={user.cpassword}
            onChange={handleInput}
            required
          />
          <br />

          <button type="submit" className="secandorybutton" onClick={postData}>
            Sign Up
          </button>
          <p className="paragraph">
            Already have an Account?{" "}
            <NavLink className="login-signup-toggle" to="/login">
              Login Now
            </NavLink>
          </p>
        </form>
      </div>
    </div>
  );
};

export default RegistrationForm;
